(1, 'Adolf Hitler', 'Adolf Hitler was a German politician who was the leader of the Nazi Party Chancellor of Germany from 1933 to 1945 and FÃ¼hrer (\"Leader\") of Nazi Germany from 1934 to 1945. As dictator, Hitler initiated World War II in Europe with the invasion of Poland in September 1939, and was central to the Holocaust.\r\nUnder Hitler\'s leadership and racially motivated ideology, the Nazi regime was responsible for the genocide of at least 5.5 million Jews and millions of other victimswhom he and his followers deemed Untermenschen (sub-humans) or socially undesirable. Hitler and the Nazi regime were also responsible for the killing of an estimated 19.3 million civilians and prisoners of war. In addition, 29 million soldiers and civilians died as a result of military action in the European theatre of World War II. The number of civilians killed during the Second World War was unprecedented in warfare and the casualties constituted the deadliest conflict in human history.\r\n', );
