(2, 'Benito Mussolini', 'Benito Amilcare Andrea Mussolini was an Italian politician, journalist and leader of the National Fascist Party ruling the country as Prime Minister from 1922 to 1943âconstitutionally until 1925, when he dropped all pretense of democracy and set up a legal dictatorship.\r\nThe Allies invaded Sicily on 24 July 1943. That same day, Mussolini was deposed by the Grand Council of Fascism, who motioned of no confidence towards Mussolini, while the King dismissed and arrested him the following day. On 12 September 1943, Mussolini was rescued from prison in the Gran Sasso raid by German special forces. In late April 1945, in the wake of near total defeat, Mussolini and his mistress Clara Petacci attempted to flee to Switzerland, but both were captured by Italian communists and summarily executed by firing squad. His body was then taken to Milan, where it was hung upside down at a service station to publicly confirm his demise. \r\n', );
INSERT INTO `people` (`id`, `name`, `information`, `pic`) VALUES
(3, 'Joseph Stalin', 'Joseph Vissarionovich Stalin was a Georgian-born Soviet revolutionary and political leader. Governing the Soviet Unionas its dictator from the mid-1920s until his death in 1953, he served as General Secretary of the Central Committee of the Communist Party of the Soviet Unionfrom 1922 to 1952 and as Premier of the Soviet Union from 1941 to 1953. Ideologically a Marxist and a Leninist, Stalin helped to formalise these ideas as MarxismâLeninism while his own policies became known as Stalinism.\r\nWidely considered one of the 20th century\'s most significant figures, Stalin was the subject of a pervasive personality cult within the world MarxistâLeninist movement, for whom Stalin was a champion of socialism and the working class. Since the fall of the Soviet Union, Stalin has retained popularity in Russia and Georgia as a victorious wartime leader who established the Soviet Union as a major world power. Conversely, his autocratic government has been widely denounced for overseeing mass repressions, hundreds of thousands of executions and millions of non-combatant deaths through his policies.\r\n', );
INSERT INTO `people` (`id`, `name`, `information`, `pic`) VALUES
(4, 'Franklin D. Roosevelt', 'Franklin Delano Roosevelt  commonly known as FDR, was an American statesman and political leader who served as the 32nd President of the United States from 1933 until his death in 1945. A Democrat, he won a record four presidential elections and emerged as a central figure in world events during the mid-20th century. He directed the United States government during most of the Great Depression, implementing his New Deal domestic agenda in response to the worst economic crisis in U.S. history. As a dominant leader of his party, he built the New Deal Coalition, realigning American politics into the Fifth Party System and defining American liberalism throughout the middle third of the 20th century. His third and fourth terms were dominated by World War II. He is often rated by scholars as one of the three greatest U.S. Presidents, along with George Washington and Abraham Lincoln.', );
